#--------- Global Settings -----------
label                 = infra-default_O2
makeflags             = -j16
reportable            = no
strict_rundir_verify  = no
teeout                = yes
tune                  = base

#--------- How Many CPUs? ------------
intrate,fprate:
   copies            = 16
intspeed,fpspeed:
   threads           = 16

#--------- Compilers -----------------
default:
    CC                 = /home/test/workspace-15/llvm/build/bin/clang -O2 -Wno-int-conversion -DSPEC_OPENMP -fopenmp -Wno-deprecated-non-prototype
    CXX                = /home/test/workspace-15/llvm/build/bin/clang++ -O2 -Wno-int-conversion
    FC                 = /usr/bin/gfortran
    CLD                = /home/test/workspace-15/llvm/build/bin/clang -Wl,-z,now -fopenmp -L/home/test/workspace-floatzone/floatzone/build/packages/rusage-counters/install/lib -Wl,--whole-archive -l:librusagecounters.a -Wl,--no-whole-archive
    CXXLD              = /home/test/workspace-15/llvm/build/bin/clang++ -Wl,-z,now -fopenmp -L/home/test/workspace-floatzone/floatzone/build/packages/rusage-counters/install/lib -Wl,--whole-archive -l:librusagecounters.a -Wl,--no-whole-archive
    COPTIMIZE          = -std=c99 -g -ggdb -fsanitize=mesh -flto -ffast-math -funroll-loops -fomit-frame-pointer -ftree-vectorize -fprefetch-loop-arrays
    CXXOPTIMIZE        = -std=c++03 -g -ggdb -fsanitize=mesh -flto -ffast-math -funroll-loops  -fomit-frame-pointer -ftree-vectorize -fprefetch-loop-arrays
    CC_VERSION_OPTION  = --version
    CXX_VERSION_OPTION = --version
    FC_VERSION_OPTION  = --version

#--------- Portability -----------------
default:
     EXTRA_PORTABILITY = -DSPEC_LP64

500.perlbench_r,600.perlbench_s:
